import React from 'react'
import {Card, CardBody, CardText, CardImg, CardTitle, CardSubtitle, Button} from "reactstrap"
import "./post.css"


//Adding cards and specified by props coming from posts as a selector
//Styling with reactstrap
const Post = ({post}) =>{
    return (
        <Card>
        <CardImg top width="100%" height="350px" src={post.selectedFile} alt="Card image cap" />
        <CardTitle tag="h5" className="creator">Card creator</CardTitle>
        <CardBody>
          <CardTitle tag="h5">Card title</CardTitle>
          <CardSubtitle tag="h6" className="mb-2 text-muted">Card subtitle</CardSubtitle>
          <CardText>This is a wider card with supporting text below as a natural lead-in to additional content. This content is a little bit longer.</CardText>
          <Button>Button</Button>
        </CardBody>
      </Card>
    )
}

export default Post
